          <img
            src="./images/cover.jpg"
            alt=""
            className={styles.contentCover}
          />
          <div className={styles.contentTitle}>{playlist.name}</div>
          {this.state.currentIndex === index ? (
            <div className={styles.contentSelector}></div>
          ) : null}
        </div>
      </div>
    );
  }
}

export default Home;
